INSERT INTO `documents1` VALUES (1001,'Ecommerce Model','Ecommerce','admin','1001.pdf','2023-03-27','11:27:41','DataSetDoc',_binary 'b\'A Reliable E-commerce Business Model Using Blockchain Based Product Grading System A Reliable E-commerce Business Model Using Blockchain Based Product Grading System Ching-Nung Yang Dept. of Computer Science & Information Engineering National Dong Hwa University Hualien, Taiwan e-mail: cnyang@gms.ndhu.edu.tw Yi-Cheng Chen, Shih-Yu Chen, Song-Yu Wu Dept. of Computer Science & Information Engineering National Dong Hwa University Hualien, Taiwan e-mail: 610721225@gms.ndhu.edu.tw Abstract4The first step in online shopping is, apparently, to choose a reliable supplier. However, consumers and merchants may have different perceptions of product quality, and this may result in business disputes. The dispute about buying inferior goods may be caused from simple product photos or merchants make over the top claims about their products. This dispute problem cannot be resolved completely, even though customers choose reputable e-commerce companies, e.g., Amazon.com and Alibaba.com. In the final analysis, the cause is that e-commerce companies do not adopt quality rating to evaluate products. If there is an alliance, among e-commerce companies and trusted organizations, which establishes credible product grading system (PGS), online shoppers may buy genuine product at a fair price from this e-commerce alliance. In this paper, we propose blockchain based PGS (BPGS) to deal with big data for this business model. The blockchain is a decentralized technology, and thus we can speed up the verification of product grading. In addition, for the proposed BPGS, 51% of attacks cannot be completed unless 51% of merchants and e-commerce companies in this alliance are simultaneously compromised. Therefore, our e-commerce environment based on BPGS is not only reliable but also secure. Keywords- e-commerce; product grading system; blockchain; smart contract I. INTRODUCTION In 2017, an estimated 1.66 billion people worldwide purchase goods online, from online retailing corporations such as, Amazon.com, Alibaba.co, and JD.com. During the same year, global e-commerce sales amounted to 2.3 trillion U.S. dollars. Recently, more and more customers are fascinated with online shopping activities, e.g., the very famous cDouble 11d shopping carnival. The Double 11 is originated from cTaobao Mall Promotion Dayd held by the Chinese e-commerce company Alibaba on November 11, 2009, and it is a day when Chinese people go on massive Internet shopping carnival because many online stores offer huge discounts on this day. Now, Double 11 has evolved into an annual shopping spree, and affects the global retail industry. The above implies that e-commerce is very important for our daily life. There are many online shoppers now shopping via their smartphone weekly, and this already becomes their main shopping way. Obviously, the first step in online shopping is to choose a reliable supplier, such that we can buy genuine products at a reasonable price. This is why many online shoppers get inspiration for purchasing from social networks. Via social circle, they try to insure the product quality and hope that the product is worth the price they paid. It seems that we are now entering the era of social shopping. However, there are many online shopping scams via social network, e.g., scammers pretend to be legitimate online sellers, either with a fake social account (Facebook, Line, or Wechat). Even though online shoppers choose reputable e-commerce companies, this dispute problem cannot be resolved completely. Because consumers and suppliers may have different perceptions of product quality. To completely, solve this problem, in this paper, we form an alliance including e-commerce companies and trusted organizations to establish a credible product grading system (PGS). Based on the PGS, customers may buy products with high grades to insure product quality. To efficiently and securely to deal with such big data for product grading, we adopt a decentralized blockchain technology [1]. The structure of this paper is as follows. Section 2 discusses background information about blockchain and smart contract. Analysis of current situation and motivation are described in Section 3. Section 4 describes how Ethereum smart contracts were designed to implement the proposed BPGS, on which a more reliable and secure e-commerce business model is achieved. Conclusion is drawn in Section 5. II. BACKGROUND A. Blockchain Technology The basic concept of blockchain was proposed by Nakamoto Satoshi [1]. Blockchain is a decentralized database using cryptographic technology to generate associated blocks, where each block records full transactions over a period of time. Each node contains a complete historical block, and even if one node is modified, it will not affect the verification of entire blockchain. The blockchain information is public, and anyone can search the chain for historical trading information. Blockchains require miners, when any node in blockchain generates a transaction, the transaction is broadcast to each miner, and all miners may verify the transaction through the proof of work mechanism [2]. Blockchain has the following main features: (i) the ability of anti-modification (ii) the ability of tolerance 3412019 the 4th IEEE International Conference on Big Data Analytics978-1-7281-1282-4/19/$31.00 \\xc2\\xa92019 IEEE as some nodes are faulty (iii) the ability of reaching collaborative trust among nodes in this distributed peer-to-peer system without the third-party certification agency (iv) the ability of accessing information of blockchain at any node in this network. A blockchain consists of continuous blocks, each block records and stores serial transections as a Merkle root by using Merkle tree algorithm in a period of time, and every block after the first block (called genesis block) has a cryptographic hash value of previous block (called parent block). All these hashed values are assembled into a chain, as shown in Fig. 1. hash of block n 1block n block n+1 block n+2transactionstimestamp... ...hash of block nhash of block n+1transactionstimestamptransactionstimestamp Figure 1. Construction of blockchain. On the other hand, the private blockchain [3] has no mining mechanism and miner9s role, because the private chain is usually used as a network within company, organization and members. For example, IBM blockchain platform provides a private chain for more than 400 cooperatives, Walmart offers solutions that provide traceability of food tracking through blockchains to make food supply chain safety, and Maersk builds a global platform to achieve efficient transportation. In fact, the blockchain is widely used in various intended applications, e.g., in Internet of Things [4-7], or use for small mobile payments [8], cloud computing [9], digital certificate [10, 11] and other application scenarios. B. Ethereum and Smart Contract The Ethereum virtual machine (EVM) is designed based on a peer-to-peer network protocol. Anyone can participate in the network and play the role of a verifier, i.e., a miner, which is a basic element in EVM. This virtual machine is an environment that runs smart contracts, which the term smart contract was first introduced by Szabo in 1994, where the smart contract is defined as ca computerized transaction protocol that executes the terms of a contractd [12]. Precisely, smart contracts are compiled as bytecodes and executed in EVM through the computer of miners, which is very similar to Java executed in Java Virtual Machine (JVM). When the smart contract operates, it must be packaged by the miner, and written into the blockchain. Each blockchain in Ethereum has various functions and purposes. We can develop intended applications in Ethereum by writing a smart contract [13-15]. Compared with traditional contract, a smart contract is an executable code stored and running in blockchain. The smart contract may execute independently and automatically without third parties, and these running results are irreversible on blockchain and are trackable by each participant. The main features of smart contract are given as follows [15]. The smart contract has stability that a smart contract has deterministic feature: the same input always produces the same output. Because smart contracts are executable codes stored in block chain, every network participant can inspect them. Meanwhile, all the interactions with a smart contract occur via signed messages on the blockchain (see Fig. 1), and thus every participant may verify and trace the contract9s operations. III. SITUATION ANALYSIS AND MOTIVATION A. Analysis of Current Situation The online shopping has been on the rise. Because consumers and suppliers may have different perceptions of product quality, this may result in business disputes. Generally, the dispute about buying inferior goods is caused by the difficulty in distinguishing qualities of goods via simple product photos, advertisements that merchants make over the top claims about products, or online shopping scams via social media. Good consumption experiences may make customers buy more products, and it is a positive cycle in online shopping environment. This is a simplified and obvious observation, but how to easily buy genuine goods at a reasonable price from online shopping is a big challenge for both customer and e-commerce company. In this paper, we give it careful consideration. B. Motivation Some e-commerce companies already have the scheme to expand seller9s business. For example, on Alibaba.com, seller may apply Gold Supplier (GS) membership in Alibaba.com. All suppliers who are interested in doing business with buyers worldwide, can apply GS membership. Through authentication and verification by Alibaba.com, sellers may gain more trust from buyers, and promote their products to maximize product exposure on Alibaba.com. Of course, GS must pass some checks by Alibaba.com to approve their membership, which should be updated every year. The GS membership is only authenticated and verified for supplier. The proposed PGS is motivated from GS membership, but further apply authentication and verification on products rather than on sellers. In addition, GS is a paid membership only used in Alibaba.com. In the proposed PGS, we form an alliance including e-commerce companies and trusted organizations to finish product grading. After approval, suppliers are authorized to display the score of PGS (an icon to demonstrate their qualities of products). Because an alliance includes more than one e-commerce company, the PGS impacts widely in e-commerce environment than GS. Therefore, using PGS may create more awareness and give more exposure to the products. PGS is a better way to insure product quality (as we know, even famous sellers may have poor products), or rather PGS is a best way to resolve dispute problem in online shopping environment. However, compared with the number of sellers, the number of products from all suppliers will be so huge. Therefore, in this paper, we adopt blockchain, a decentralized technology, to deal with such big data for 342 product grading. In the proposed BPGS, 51% of attacks cannot be completed unless 51% of e-commerce companies and trusted organizations in this alliance are simultaneously compromised. Therefore, our business model based on BPGS is not only reliable but also secure. IV. DESIGN AND IMPLEMENTATION OF BPGS BY SMART CONTRACT At the present, Ethereum is the most popular public blockchain platform for developing smart contracts, since it provides a built-in language called Solidity, which is a contract-oriented language that can be applied to deploy contracts to the EVM. In this section, we implement the proposed BPGS by using Remix to write Solidity smart contracts. A. Framework Fig. 2 illustrates the block diagram of the proposed BPGS in e-commerce business model. Suppliers provide products to the alliance, which includes e-commerce companies and trusted organizations (e.g., Consumers International, a non-profit organization), for product grading. After verification and product grading, the manager of alliance writes the data into a new block on the blockchain via operating smart contracts. Based on the proposed BPGS, customers may buy products with high grades to insure product quality. The information of the blockchain cannot be modified, and thus customers can trust the product grade. Meanwhile, the blockchain is a decentralized technology, and thus buyers can finish the verification of product grading via the BPGS efficiently and securely. Finally, customers may purchase goods in a reliable and secure online shopping environment. : e-commerce company...Alliance: trusted organization: sellers product: buyer: smart contract: graded producthash of block ntransactionstimestamp...Alliance Figure 2. Block diagram of BPGS in e-commerce bussines model. B. Implementation Details We have implemented a prototype consisting of four different smart contracts in Figs. 3~6. As shown in Fig. 3, cProductGraded is used for storing product information, product grade, and the information of valuators. Note: N valuators are the members in this alliance (e-commerce company or trusted organization), and are assigned by the manager of this alliance. And, finally all information of product, valuators, and the score are recorded in the events: Send_info, Send_result, and Send_list. The code in Fig. 4 demonstrates that the constructor of smart contract is set as the manager of this alliance. When the manager and the valuator in this alliance want to carry out functions, e.g., the manage would like to assig some members as valuators, or the valuator wants to grade the product. They should be verified through CheckManager() and CheckValuator(). Figure 3. Information of product, grade, and valuator in smart contract. Figure 4. Verfication of manager and valuator in smart contract. The function AssignVaulator() in Fig. 5 is used for that the manage would like to assign some members as valuators. As show in Fig. 5, this function includes CheckManager(), such that only the manager can apply this function. Other two functions Store() and LoadData() in Fig. 5 store the information of product and supplier, on which valuators may grade thes products. To make sure that only valuators may apply the grading process, this function includes CheckValuator(). 343 Figure 5. Functions in smart contract. Fig. 6 is the grading process cGraded function. For grading products, all the scores of N valuators will be given and summarized by valuators, and then return the score to Send_result. Figure 6. Product grading in smart contract. V. CONCLUSION Motivated from the concept of Gold Supplier in Alibaba.com., we apply the grading system on products rather than on suppliers. Meanwhile, for dealing with huge verification and grading for products, we adopt blockchain, a decentralized technology, to deal with such big data for product grading. We design and implement the BPGS by smart contracts. Finally, our business model based on BPGS is reliable, efficient, and secure. ACKNOWLEDGMENT This work was partially supported by Ministry of Science and Technology, under Grant MOST 107-2221-E-259-007. REFERENCES [1] S. Nakamoto, cBitcoin: A Peer-to-Peer Electronic Cash System,d, 2008, available at https://bitcoin.org/bitcoin.pdf. [2] C. Dwork and M. Naor, cPricing via Processing or Combatting Junk Mail,d Crypto992, LNCS 740, pp. 139-147,1993. [3] Z. Zheng, S. Xie, H. Dai, X. Chen, and H. Wang, cAn Overview of Blockchain Technology: Architecture, Consensus, and Future Trends,d 2017 IEEE International Congress on Big Data (BigData Congress), pp. 557-564, 2017. [4] K. Christidis and M. Devetsikiotis, cBlockchains and Smart Contracts for the Internet of Thingsd. IEEE Access, Vol.4, pp. 2292-2303, 2016. [5] N. Kshetri, cCan Blockchain Strengthen the Internet of Things?,d IT Professional, Vol. 19, pp. 68-72, 2017. [6] D. Miller, cBlockchain and the Internet of Things in the Industrial Sector,\" IT Professional,d Vol. 20, pp. 15-18, 2018. [7] R. Li, T. Song, B. Mei, H. Li, X. Cheng, and L. Sun, cBlockchain for Large-Scale Internet of Things DataStorage and Protection,d IEEE Transactions on Services Computing, doi: 10.1109/TSC.2018. 2853167, 2018. [8] A. Xu, M. Li, X. Huang, N. Xue, J. Zhang, and Q. Sheng, cA Blockchain Based Micro Payment System for Smart Devices,d International Journal of Design, Analysis and Tools for Integrated Circuits and Systems (IJDATICS), 2016. [9] Jin Ho Park, Jong Hyuk Park, cBlockchain Security in Cloud Computing: Use Cases, Challenges, and Solutionsd, Symmetry, 9, 164; doi:10.3390/sym9080164, 2017. [10] H. Orman, cBlockchain: the Emperors New PKI?,d IEEE Internet Computing, Vol. 22, pp. 23-28, 2018. [11] E. Karaarslan and E. Adiguzel, cBlockchain Based DNS and PKI Solutions,d IEEE Communications Standards Magazine, Vol. 2, pp. 52-57, 2018. [12] N. Szabo, cSmart Contracts,d 1994, available at http://www. fon.hum. uva.nl/rob/Courses/InformationInSpeech/CDROM/Literature/LOTwinterschool2006/szabo.best.vwh.net/smart.contracts.html. [13] D. Magazzeni and P. McBurney, cValidation and Verification of Smart Contracts: A Research Agenda,d Computer, Vol. 50, pp. 50-57, 2017. [14] V. Buterin, cEthereum White Paper: A Next Generation Smart Contract & Decentralized Application Platform,d 2013, at http:// blockchainlab.com/pdf/Ethereum_white_paper-a_next_generation_ smart_contract_and_decentralized_application_platform-vitalik-buterin.pdf. [15] C. Braghin, S. Cimato, E. Damiani, and M. Baronchellli, cDesigning smart-contract based auctions,d The 2nd International Conference on Security with Intelligent Computing and Big-data Services (SICBS 2018), Guilin, China, Dec., 2018. 344\'','NA'),(1002,'research paper','test','admin','1002.pdf','2023-03-27','12:16:57','DataSetDoc',_binary 'b\'Blockchain-Based E-Vote-as-a-ServiceBlockchain-based e-Vote-as-a-ServiceEmanuele Bellini1 IEEE Member, Paolo Ceravolo2 IEEE Member, Ernesto Damiani IEEE Member 1Abstract4 This article aims at introducing a new config-urable and multipurpose electronic voting service based onthe blockchain infrastructure. The objective is to design anarchitecture to automatically translate service configurationdefined by the end user into a cloud-based deployable bundle,automating business logic definition, blockchain configuration,and cloud service provider selection. The article presents thepreliminary results of the system and a SOA-based servicesdefinition implemented with smart contracts.I. INTRODUCTIONIn recent years, businesses have entered into the cloudcomputing era, where virtually turning anything into anonline service (XaaS) has become a distinct possibility [19].Strangely enough, this is not yet true for the e-Votingservices, mainly because the recent examples of adoptionof e-Voting in political elections has revealed significantcritical issues such as low transparency and vulnerability [5].We, however, claim that there are a number of cases indaily life in which electronic vote may be successfullyapplied. Examples include elections in private or restrictedorganizations. For instance, the election of a company9sexecutive officers where each shareholder is entitled to onevote per share multiplied by the number of officers to beelected. The rule for such voting system may be so rigidending up to reduce their inclusiveness in some cases (thevoting task is performed with a reduced number of votersavailable) or to affect the functioning of the organization,as the achievement of all the conditions required for avalid vote may delay the appointment of officers. In thisrespect, e-Voting systems can significantly reduce the costsof implementation and verification as well as ease andincentive the participation of voters thanks to its ubiquity.Moreover, the introduction of the Blockchain technologyallows to robustly cover all the security and reliabilityrequirements imposed by voting procedures. By contrast, inthe current state of the art, Blockchain represents a staticand monolithic technological solution strongly dependent onthe contingent business case addressed. Since its inception,the Blockchain industry has witnessed the launch of 80,000projects, according to the China Academy of Information andCommunications Technology (CAICT). Only 8% of themare actively maintained while the remaining 92% failed withan average lifespan of 1.22 years. In fact, in Blockchain-based projects, parameters such as the numbers of peers,1E. Bellini is with Khalifa University, Center of Cyber-Physical Systems,UAE emanuele.bellini at ieee.org2P. Ceravolo is with the Department of Computer Science EUniversityof Milan, Italy paolo.ceravolo at unimi.it2E. Damiani is with the Khalifa University Center of Cyber-PhysicalSystems, UAE ernesto.damiani at ku.ac.aeHW/SW requirements, the computational performance, andso forth, are typically addressed at the design time by asystem administrator and are not appropriately tailored onthe business process to be addressed. In order to overcomesuch issues, the proposed solution aims at considering thoseparameters as a matter of service. Our Blockchain-based e-Vote-as-a-Service relies on an architecture that dynamicallyselects, deploys and execute an e-Voting service. This wayrequirements are directly selected by the end users andorganizations of any dimension will be able to set-up asecure and transparent voting service using a pay-per-useconfigurable approach, bringing on costs during the limitedtime-frame of an election. As regards of the service provider,this approach allows optimizing the allocation of resourcesas the same infrastructure can serve different customers indifferent time frames.II. RELATED WORKThe The e-Vote base on blockchain is becoming a fieldof experiment. Several initiatives as commercial level existsas Bitcongress [1], Followmyvote [2] and TIVI [3]. Otherimplementations are [3], [20], [21]. However, none of themhave considered blockchain in terms of service that hasits own costs of design and execution and its life cycle.Moreover, they tend to conceive blockchain as a static toolneglecting its obsolescence and rigidity once it is deployed.III. CONFIGURABLE E-VOTEThe e-Voting scenario defines three actors: a) the VotingService Provider V SP , b) the organization O interested inthe voting results, and c) the electoral body, i.e the votersV . These three actors interact with each other through theVoting Process V P . In fact, an organization O is composedof M members whose some of them are entitled to express avote on a topic, with V\\x89\\xa4M. The voting mechanism VMECis defined by a set of rules (e.g. the method to define awinner, the definition of a quorum, the timing for expressthe vote, etc.) that are assumed well-know by the voters.The realization of a fully configurable BC-based e-Voteimplies the definition of a platform-as-a-service environmentaddressing the properties of service at three abstractionlevels.\\xa2 (A1) Business Process, defining the orchestration ofautonomous services according to the voting protocol.\\xa2 (A2) Business Logic, defining the behavior of everysingle service (smart contract).\\xa2 (A3) Transaction data, defining the properties transac-tions have to guarantee (security, speed, privacy, etc.).4842019 IEEE 12th International Conference on Cloud Computing (CLOUD)2159-6190/19/$31.00 \\xc2\\xa92019 IEEEDOI 10.1109/CLOUD.2019.00085Fig. 1. An overview of the serviceSince there are a number of functional and securityconstraints for a robust e-Voting service specified in [3],[4]that a V SP should respect, the most promising improvementin the current e-Voting service is represented by a methodto minimize the internal operational costs. To this end, weidentified the following challenges as the most relevant inthe e-Voting context:\\xa2 (C1) Automating the implementation of a businessprocess specifying the operational stages of a vote (A1).\\xa2 (C2) Semi-automating the generation of smart contracts(chaincode) addressing the logic of individual services(A2).\\xa2 (C3) Automating blockchain configuration (A3).\\xa2 (C4) Automating system deployment and optimizing theuse of computational resources (A3).IV. SYSTEM DESIGNA. System ConfigurabilityFinding a near-optimal configuration for highly config-urable systems requires to deal with exponential space com-plexity [6]. This relates to the size of the combinations tobe considered (the power set of the assessed features) butalso to the fact the feature interactions introduce performancedependencies with other features so in determining perfor-mances it is not possible to simply aggregate the contributesprovided by every single feature in a combination. To makeperformance prediction practicable two general strategieshave been followed.In sampling-centric solutions the goal is generating amodel from a restrict set of samples, as restricted as pos-sible, keeping at the same time the prediction accuracysignificant. Random sampling is regarded as the standardoperating procedure [7] however, true sampling approachshould consider only valid configurations. Filtering out in-valid configurations is a possible answer [8] but this solutiondoes not avoid to generate the entire set of configurations[9]. Encoding configurations in a feature model that usingpropositional formulas can reveal inconsistent configurations,i.e. conjunctions of features in the model, avoiding to explorethe entire configuration space [6]. Statistical procedures havebeen adopted in order to sampling using the most significantvariance [10] if necessary in conjunction with other variables,such as acquisition cost, for instance, [11], the predictionpower of a method can be improved by exploiting theinformation that is gained from the system itself.Model-centric solutions start from the assumption thatmeasuring the performances of a real system is typicallytime-consuming, costly and implies risks of damaging thesystem itself. For this reason, model-driven approaches maybe preferred. For example, performance annotated softwarearchitecture models (e.g. UML2) can be transformed intostochastic models (e.g. Petri Nets) to then apply analyticalor simulation-based optimization methods. A comparativeassessment of different approaches with the trade-offs theyentail is proposed in [13]. Feature Models can be exploited torepresent the interdependencies between features in configu-rations restricting the sampling space to valid configurationsor identifying the minimum set of features required todetermine a performance [14]. Our approach implements amodel-centric view as it guarantees a fast application at thedifferent specification levels handled by our architecture. Themodels we use for connecting features and performance arehowever updated based on the results obtained during byrunning the system and monitoring its operating results.B. Service componentsFig. 2. Architecture overview1) Plan Configurator (C1): The Plan Configurator isthe interface a customer can use to specify the propertiesrequired by the desired voting session. This is shaped as abusiness process, then it is translated into parameters used tocompose the e-Vote Cloud Bundle. For each block includedin the business process, a number of performance and featureoptions can be selected. Each selection is reflected in achange in the performances constraining the Service LevelAgreement (SLA) and impacts on the final pricing.2) Smart Contract Composer (C2): The specificationsdefined in the Plan Configurator input the Smart ContractComposer. The component is devoted to automating theVMEC and includes a catalog of pre-defined Smart Con-tracts (SC) to be used as a template for a common votingmechanism. Customization of a voting mechanism can besupported by a specific wizard. The Smart Contract selectionand implementation follow the Service Oriented Architecture485model specification [15]. There are different approachesfor service modeling, as surveyed in [16]. In the presentwork, we adopted SOMF nomenclature since it provides aformal method of service identification at different levels ofabstraction, from holistic to detailed [17], [18]. Then theSC can be divided into Atomic, Composite and ClusteredServices according to their business logic. Examples ofAtomic Services are:\\xa2 V oterAuthentication: the service verifies the creden-tials of the participant entitled to vote.\\xa2 PoolCreation: the service acquires the accounts of thevoters from a list and set a create a new pool.\\xa2 TokenGeneration: the service generates a token for agiven voter and Pool ID.Examples of a Composite Service could be theV oteCollection that takes as input the Pool ID andprovided as output the matrix of the votes collected,and to do so needs to execute atomic services such asPoolCreation. The Cluster Services are represented bythe entire BP defined by the end-user. An example couldbe a V otingSessionSimple where, in input are provided(Voters list, counting methods, Date start, date end) and asoutput, the user obtains the final Report.3) Blockchain configurator (C3): The Blockchain Orches-trator translates some user parameters like performance, datapreservation, security and costs into specific infrastructurecharacteristics (e.g. number of peer nodes, computation capa-bility of the hosts, etc.). In this way, it is possible to calibratethe complexity and the performance of the infrastructureaccording to the user request. Once the right configurationis decided, it is included in the bundle.4) Cloud Deployer Orchestrator (C4): This componentperforms a matchmaking analysis between the criteria de-fined in the bundle and the could services hosted in theinternal catalog. The matching algorithm should respect allthe criteria expressed by the end-user as well as the gain themaximization of the e-vote service provider Thus the CloudDeployer Orchestrator automates the deployment of virtualmachines, their configuration, provisioning, and intra-serviceorchestration according to the e-Voting Cloud Bundle.V. CONCLUSIONSOur proposal aims at developing an e-Vote-as-a-Servicebased on Blockchain overcoming the limitations of thecurrent projects using a cloud-based approach. Even if anumber of cloud providers such as IBM and Oracle areoffering ready-to- use blockchain installation on cloud witha fee based on the number of transactions, the challenge of adynamic and on-demand system configuration and optimiza-tion based on end users business requirements remains. Thepresent approach allows the end users to specify functionaland non-functional requirements of services and the Cloudinfrastructure where services are deployed on demand tooptimize costs and service performance.REFERENCES[1] BitCongress. Control the world from your phone. [Online]. Available:http://www.bitcongress.org/BitCongress Whitepaper.pdf[2] FollowMyVote.com, Tech. Rep., 2017. [Online]. Available:https://followmyvote.com[3] Tivi - verifiable voting: Accessible, anytime, anywhere, TIVI, Tech.Rep., 2017. [Online]. Available: https://tivi.io[4] K.-H. Wang, S. K. Mondal, K. Chan, and X. Xie, A review of contem-porary e-voting: Requirements, technology, systems, and usability, inData Science and Pattern Recognition, vol. 1, no. 1, pp. 3147, 2017.[5] J. A., Halderman (2016). dPractical attacks on real-world e-votingd, inReal-World Electronic Voting (pp. 159-186). Auerbach Publications.[6] J. Oh, D. Batory, M. Myers, and N. Siegmund, dFinding near-optimalconfigurations in product lines by random samplingd, in Proceedingsof the 2017 11th Joint Meeting on Foundations of Software Engineer-ing. ACM, 2017, pp. 6171.[7] Y.Zhang, J.Guo, E.Blais, and.Czarnecki,dPerformance prediction ofconfigurable software systems by Fourier learning (t)d, in 2015 30thIEEE/ACM International Conference on Automated Software Engi-neering (ASE), pp. 365373.[8] A. S. Sayyad, T. Menzies, and H. Ammar, dOn the value of userpreferences in search-based software engineering: a case study insoftware product linesd, in Proceedings of the 2013 InternationalConference on Software Engineering. IEEE Press, 2013, pp. 492501.[9] C.Henard, M.Papadakis, M.Harman, andY.LeTraon,dCombining multi-objective search and constraint solving for configuring large softwareproduct linesd, in 37th International Conference on Software Engi-neering. IEEE Press, 2015, pp. 517528.[10] J. Guo, K. Czarnecki, S. Apel, N. Siegmund, and A. Wasowski,Variability-aware performance prediction: A statistical learning ap-proach, in Automated Software Engineering (ASE), 2013 IEEE/ACM28th International Conference on. IEEE, 2013, pp. 301 311.[11] A. Sarkar, J. Guo, N. Siegmund, S. Apel, and K. Czarnecki, Cost-efficient sampling for performance prediction of configurable systems(t), in Automated Software Engineering (ASE), 2015 30th IEEE/ACMInternational Conference on. IEEE, 2015, pp. 342352.[12] P. Jamshidi and G. Casale, An uncertainty-aware approach to optimalconfiguration of stream processing systems, in Modeling, Analysisand Simulation of Computer and Telecommunication Systems (MAS-COTS), 2016 IEEE 24th International Symposium on. IEEE, 2016[13] F. Brosig, P. Meier, S. Becker, A. Koziolek, H. Koziolek, and S.Kounev, Quantitative evaluation of model-driven performance anal-ysis and simulation of component-based architectures. IEEE Trans.Software Eng., vol. 41, no. 2, pp. 157175, 2015.[14] R. Schroter, S. Krieter, T. Thum, F. Benduhn, and G. Saake, Feature-model interfaces: the highway to compositional analyses of highly-configurable systems, in 38th International Conference on SoftwareEngineering. ACM, 2016, pp. 667678.[15] M. Bell (2008). dIntroduction to Service-Oriented Modelingd. Service-Oriented Modeling: Service Analysis, Design, and Architecture. Wileyand Sons. ISBN 978-0-470-14111-3.[16] Mohsen Mohammadi Muriati Mukhtar, dA Review of 